import React from "react"
import { View, Text, Image } from "react-native"
import styled from "@emotion/native"
import AffixImages from "../data/affixImages"
import dungeonImages from "../data/dungeonImages"

const Card = styled.View`
    width: 80%;
    height: 30px;
    display: flex;
    flex-direction: row;
    z-index: 0;
`

const AffixImage = styled.Image`
    height: 20px;
    width: 20px;
    z-index: 0;
`

const AffixContainer = styled.View`
    display: flex;
    flex-direction: row;
    width: 30%;
    justify-content: space-around;
    z-index: 0;
`
const Title = styled.Text``

const MythicPlusRunCard = (props) => {
    const data = props.data
    return (
        <Card>
            <Title>{data.dungeon}</Title>

            <Text>
                {props["data"]["mythic_level"]}

                {props["data"]["num_keystone_upgrades"]}
            </Text>
            <AffixContainer>
                {data.affixes.map((affix, index) => {
                    return (
                        <AffixImage
                            source={AffixImages[affix.name]}
                            key={index}
                        />
                    )
                })}
            </AffixContainer>
        </Card>
    )
}

export default MythicPlusRunCard
